      correctLogin = false;
   }


  return (
     <Router>
    <div className="App">
      <Heading />
      <Switch>
      <Route path="/" exact component={Home}/>
      <Route path="/appointment"component={Appointment}/>
      <Route path="/contacts"component={Contacts}/>
      <Route path="/login"component={Login}/>
      </Switch>
      </div>
       </Router>
  );
}

export default App;
